Základními body spolupráce a vzájemné podpory jsou:
1. odstraňování bariér a zpřístupňování veřejného prostranství a konzultace v rámci bezbariérového užívání staveb na území MČ Praha 12;
2. vzájemná spolupráce na přípravě bezbariérového prostředí v rámci rekonstrukcí budov, veřejných prostranství a komunikací;
3. vzdělávání veřejnosti;
4. spolupráce v oblasti propagace a informování veřejnosti;
5. podpora společných projektů.

Nedostatek lékařů v Praze 12 a moje schůzka s ředitelem polikliniky 🏨; 
navázání spolupráce s Národní radou zdravotně postižených a NIPI znamená zásadní obrat k lepšímu v přístupu Prahy 12 ke zdravotně hendikepovaným 🦽;
